import React, { Component } from 'react';

class Game extends Component {
	constructor() {
		super()
		this.state = {
			boardWidth: 10000,
			boardHeight: 10000
		}
	}

	drawBoard() {
		return <div className="board" style={{width: this.state.boardWidth, height: this.state.boardHeight}}>

		</div>
	}

	render() {
		let board = this.drawBoard();
	    return (<div className="Game">
	    	{board}
	    </div>);
	}
}

export default Game;
